import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Wait for the product cards to be dynamically rendered by JavaScript
    await page.waitForSelector('.product-card .product-price');

    // Take a screenshot after products are loaded
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_products_loaded.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_products_loaded.png'));

    // Extract all product prices using page.$$eval
    const prices = await page.$$eval('.product-price', (priceElements) => {
      return priceElements.map(el => {
        // The price is typically the first text node within the .product-price element.
        // We find the first child node that is a text node and contains a '$'.
        const priceNode = Array.from(el.childNodes).find(node => 
          node.nodeType === Node.TEXT_NODE && node.textContent.includes('$')
        );

        if (priceNode) {
          // Clean the text: remove '$', trim whitespace, and convert to a number
          const priceText = priceNode.textContent.trim();
          return parseFloat(priceText.replace('$', ''));
        }
        return null; // Return null if no valid price text node is found
      }).filter(price => price !== null && !isNaN(price)); // Filter out nulls and any parsing errors (NaN)
    });

    if (prices.length === 0) {
      throw new Error("No product prices could be extracted from the page.");
    }

    return {
      success: true,
      action: "Successfully extracted all product prices from the page.",
      extractedData: {
        productPrices: prices,
        count: prices.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, take a screenshot of the page state
    const errorScreenshotPath = path.join(screenshotsDir, 'error_state.png');
    await page.screenshot({ path: errorScreenshotPath });

    return {
      success: false,
      action: "Failed to extract product prices.",
      extractedData: {},
      screenshots: [errorScreenshotPath],
      error: error.message
    };
  }
}
